import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

export default function AdminMessage() {
  const [messages, setMessages] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetch("http://localhost:5000/api/admin/messages", {
      headers: { "auth-token": localStorage.getItem("token") }
    })
      .then(res => res.json())
      .then(data => setMessages(data.messages));
  }, []);

  return (
    <div className="container py-4">
      <h3>Inbox</h3>

      {messages.map(msg => (
        <div
          key={msg._id}
          className="border p-3 mb-2 rounded cursor-pointer"
          onClick={() => navigate(`/admin/messages/${msg._id}`)}
        >
          <strong>{msg.fullname}</strong>
          <p className="mb-1">{msg.message}</p>
          <span className="badge bg-secondary">{msg.status}</span>
        </div>
      ))}
    </div>
  );
}
